column8:
H19年12月末にモデルチェンジされたフォレスターのオーディオレス車など、スバルワイドサイズ窓口付（20Pコネクター仕様車）対象の取付キットです。電源コネクターはスバル20Pコネクター。アンテナ変換コネクターほか、オプション用コネクターも同梱し「車速・バック・パーキング信号」の取出しも可能。横幅の広いワイドサイズ窓口の車に、１Ｄ＋１Ｄ～２ＤＩＮサイズのオーディオ、ナビゲーションなどの本体取付が可能です。 <br><br>■構成部品 ■パネル(ワイドサイズ用、黒) ■コネクター(20P) ■アンテナ変換コネクター ■オプション用コネクター(15P) ■ほかに取付説明書を同梱<br><br> <br><br>スバルワイドサイズ窓口  20Pコネクター仕様車 <br><br>　車検対応品<br><br>カーオーディオ、ビジュアル/配線・取付金具<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


