H16年9月に発売になったティーダ（オーディオレス車も含む）など、20P仕様の日産車用配線キットです。近年の日産20Pコネクター、角型形状のラジオアンテナに対応した製品です。H16年10月発売ティーダラティオにも使用可。日産車は純正ブラケットが市販品の取付に使用できる場合が多く、現在も本配線キットの適応車種が広がっています。 <br><br>■構成部品 ■コネクター ■アンテナ変換コネクター ■ほかに取付説明書を同梱<br><br> <br><br>ティーダ(H17/4～) <br><br>　車検対応品<br><br>カーオーディオ、ビジュアル/配線・取付金具<tr><td colspan="2">
