H17年9月より販売されているシビック（ハイブリッド含む）のオーディオレス車対象の取付キットです。電源コネクターが従来のホンダ20Pコネクターではなく、新形状の17Pコネクター仕様のセットになっています。17Pコネクターには車速信号取出し線もあり、１Ｄ＋１Ｄ～２ＤＩＮサイズのオーディオ、ナビゲーションなどの本体取付が可能です。 <br><br>■構成部品 ■専用パネル ■スポンジテープ ■サイドブラケット（Ｌ） ■サイドブラケット（Ｒ） ■コネクター(17P) ■アンテナ変換コネクター ■バインドねじx8 ■トラスタッピングねじx8 ■ほかに取付説明書を同梱<br><br> <br><br>シビック(H17/9～)オーディオレス車 <br><br>　車検対応品<br><br>カーオーディオ、ビジュアル/配線・取付金具<tr><td colspan="2">
