H17年5月にフルモデルチェンジし、新しくなったステップワゴンのオーディオレス車対象の取付キットです。２ＤＩＮサイズのオーディオはもちろん、ナビゲーションの取付も可能です。 <br><br>■構成部品 ■専用パネル ■スポンジテープ ■専用ブラケット（Ｌ） ■専用ブラケット（Ｒ） ■サイドブラケット（Ｌ） ■サイドブラケット（Ｒ） ■.コネクター ■アンテナ変換コネクター ■バインドねじx8 ■トラスタッピングねじx8 ■ほかに取付説明書を同梱<br><br>弊社従来の専用パネルを改良し、パイオニア株式会社商品：新型RAKU-NAVI（AVIC-HRZシリーズ）のフェイスオープンにも対応しています。 <br><br>ステップワゴン(H17/5～) <br><br>　車検対応品<br><br>カーオーディオ、ビジュアル/配線・取付金具<tr><td colspan="2">
